CREATE TABLE IF NOT EXISTS "auctions_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auctions_bid" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "price" decimal NOT NULL, "bidding_datetime" datetime NOT NULL, "bidder_id" integer NOT NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED, "item_id" integer NOT NULL REFERENCES "auctions_listing" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auctions_watchlist" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "item_id" integer NOT NULL REFERENCES "auctions_listing" ("id") DEFERRABLE INITIALLY DEFERRED, "watcher_id" integer NOT NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auctions_listing" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "category" varchar(10) NULL, "price" decimal NOT NULL, "photo" varchar(100) NULL, "starting_bid" decimal NOT NULL, "listing_datetime" datetime NOT NULL, "active_listing" varchar(3) NOT NULL, "watchlist" varchar(3) NOT NULL, "title" varchar(64) NOT NULL, "description" varchar(255) NULL, "listed_by_id" integer NOT NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "auctions_comment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "comment" text NOT NULL, "item_id" integer NOT NULL REFERENCES "auctions_listing" ("id") DEFERRABLE INITIALLY DEFERRED, "created_date" datetime NOT NULL, "author_id" integer NULL REFERENCES "auctions_user" ("id") DEFERRABLE INITIALLY DEFERRED);
